  return (
    <div>
      <h2>Producto Seleccionado</h2>
      {imagenUrl ? <img src={imagenUrl} alt="Producto seleccionado" /> : <p>No se seleccion√≥ ninguna imagen.</p>}
    </div>
  );
};

export default productoSeleccionado;
